import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";

const Discover = () => {
  const [page, setPage] = useState(1);
  const [content, setContent] = useState({});

  const fetchTrending = async () => {
    let temp = {};
    const { data } = await axios.get(`/Assets/data.json`);

    data.user.apps.map((item) => {
      let category = "Other";
      if ("catagories" in item) {
        console.log(item.catagories[0]);
        category = item.catagories[0];
      }
      if (!(category in temp)) {
        temp[category] = [];
      }
      temp[category].push(item);
    });

    console.log(temp);
    setContent(temp);
  };

  useEffect(() => {
    window.scroll(0, 0);
    fetchTrending();
    // eslint-disable-next-line
  }, [page]);

  return (
    <div>
      <span className="pageTitle">My Subscribed APPS</span>
      <div className="subscribe">
        {content &&
          Object.keys(content).map((key, index) => (
            <div key={index}>
              {content.map((app) => (
                <div key={app.id}>
                  <img src="https:/via.placeholder.com/350x200" alt="product" />
                  <h4>{app.name}</h4>
                  <p>{app.plan.price}</p>
                  <p>{app.plan.name}</p>
                </div>
              ))}
            </div>
          ))}
        {/* {content &&
          content.user.apps.map((app) => (
            <div key={app.id}>
              <img src="https:/via.placeholder.com/350x200" alt="product" />
              <h4>{app.name}</h4>
              <p>{app.plan.price}</p>
              <p>{app.plan.name}</p>
            </div>
          ))} */}
      </div>
    </div>
  );
};

export default Discover;
